def findMaxConsecutiveOnes(nums) -> int:
    max_count = 0
    current_count = 0
    i = 0
    while i < len(nums):
        if nums[i] == 1:
            current_count += 1
            j = i + 1
            while j < len(nums) and nums[j] == 1:
                current_count += 1
                i += 1
                j += 1
            if current_count > max_count:
                max_count = current_count
            i += 1
        else:
            current_count = 0
            i += 1
    return max_count


